description:
＜商品説明＞<br>
 スマートフォン、携帯電話用のコンパクトタイプ車載用貼付取付スタンドです<br>
 <br>
 幅：59mm～86mm、厚さ：18mm程度までの端末に利用できますので、<br>
 iPhone、XPERIA、GALAXY、AQUOS、ARROWSの初代から最新機種まで幅広く対応可能です<br>
 ３６０度回転するので横向きにも取り付け可能です<br>
<br>
 ◆　仕様 <br>
 　・両面テープ貼付タイプです（住友３Ｍ製両面テープ使用）<br>
 　・上下左右に調整可能です <br>
 　・直径58mmのコンパクト台座採用 <br> 
<br>
※業務用となりますので、外箱・説明書等は付属しておりません<br>
※領収書等の発行は行っておりません<br><!--▼common_big▼-->
