＜商品説明＞<br>
スマートフォン、携帯電話用のサンバイザークリップタイプ車載用取付スタンドです<br>
<br>
幅：59mm～86mm、厚さ：18mm程度までの端末に利用できますので、<br>
iPhone、XPERIA、GALAXY、AQUOS、ARROWSの初代から最新機種まで幅広く対応可能です<br>
<br>
３６０度回転するので横向きにも取り付け可能です<br>
<br>
◆　仕様・特徴<br>
・クリップをサンバイザーに挟み込んで取り付けします <br>
・厚さ２ｃｍ程度までのサンバイザーに取り付け可能です <br>
・垂直に起こすような角度はあまり付きません（写真参考）<br>
<br>
※領収書等の発行は行っておりません<br>
※業務用ですので説明書、外箱等はありません<br><!--▼common_big▼-->
